//Aqui creamos el modelo de la card que le pasa los valores por props desde Cards
import React from "react"
import {Link} from "react-router-dom";
import style from "./styles/Card.module.css"
const Card =({id, name, flags, continents}) =>{
    return(
        <Link to={`/countries/${id}`} style={{ textDecoration: 'none' }}>
            <div className={style.container}>
                <div className={style.card}>
                    <img className={style.img} src={flags} alt={name}/>
                    <div className={style.containertext}>
                    <h3 className={style.texttitle}>{name}</h3>
                    <h3 className={style.textid}>{id}</h3>
                    <h4 className={style.text}>{continents}</h4>
                    </div>
                </div>
            </div>
        </Link>
    )
}
export default Card;
